import React from 'react';
import './App.css';
import car1 from './Images/car.jpg';
import car2 from './Images/car2.jpg';
import car3 from './Images/car4.png';

const Menu5Img = () => {
  return (
    <section className='Menu5Img'>
      <div className='imgMenu5'>
        <img src={car1} />
      </div>
      <div className='imgMenu5'>
        <img src={car2} />
      </div>
      <div className='imgMenu5'>
        <img src={car3} />
      </div>
    </section>
  );
};

export default Menu5Img;
